import React from 'react'
import './Statistics.css'
export const Statistics = ({list}) => {
	return (
		<ul className='statistics statistics-list'>
			list.map((el, id ) => (
					<li key={id}>
						<p> {el} </p>
					</li>
				)
		</ul>
		)
}
Statistics.defaultProps = {
	list: [0,0,0]
}
